import React from "react";
import Photo from "./Photo";

const styles = {
    photoFrame: {
        height: 170,
        width: 170
    }
}

const PhotoFrame = props => (

    <li className="col-lg-2 col-md-2 col-sm-3 col-xs-4" style={styles.photoFrame}>
        <Photo url={props.url} />
    </li>

);

export default PhotoFrame;
